The Open Kitchen

Materials - Matt veneer, Leather finished granite working counters with Venetino Italian Marble fascia and dado inside and wooden lacquered finish panels above, Golden anodised aluminium portal , Tinted glass for visual from Kitchen to All day dining , Accessible ceiling made in Cement sheets finished in Laminate for easy maintenance. 

